<body ng-controller="project_list_profile">

<div id="theme-wrapper">
    <header class="navbar" id="header-navbar">
        <div class="container">
            <a href="#" id="logo" class="navbar-brand">
                <img src="img/logo.png" alt="" class="normal-logo logo-white"/>
            </a>
        </div>
    </header>



    <div id="page-wrapper" class="container">
        <div class="row">
            <div id="nav-col">
                <section id="col-left" class="col-left-nano">
                    <div id="col-left-inner" class="col-left-nano-content">
                        <div id="user-left-box" class="clearfix hidden-sm hidden-xs dropdown">
                            <img alt="" ng-src={{profile_pic}} />
                            <div class="user-box">
                                <span class="name">
                                    <a class="dropdown-toggle">
                                        {{nickname}}
                                        <!--<i class="fa fa-angle-down"></i>-->
                                    </a>
                                </span>
                            </div>
                        </div>
                        <div class="collapse navbar-collapse navbar-ex1-collapse" id="sidebar-nav" bs-navbar>
                            <ul class="nav nav-pills nav-stacked">
                                <li class="nav-header nav-header-first hidden-sm hidden-xs">
                                    Category
                                </li>

                                <!--
                                개선 후 리스트
                                Overview
                                -->
                                <li>
                                    <a data-match-route="/overview" href="#/overview">
                                        <span>Overview</span>
                                    </a>
                                </li>

                                <!--
                                Detail
                                - Filter & Error List
                                -->
                                <li>
                                    <a data-match-route="/errors"  href="#/errors">
                                        <span>Errors</span>
                                    </a>
                                </li>

                                <!--
                                Insights(현상 유지)
                                - Daily Error (Graph)
                                - Rank Rating(Graph)
                                - Recommend Error(List) (10개 단위로 표시)
                                -->
                                <li data-match-route="/">
                                    <a data-match-route="/insight" href="#/insight">
                                        <span>Insights</span>
                                    </a>
                                </li>

                                <!--
                                Statistics
                                - Retention(모든 카테고리 공통 배치)
                                - App Ver.
                                    Session
                                    Error
                                - Device
                                - SDK
                                - Country
                                - Code
                                    - Class
                                    - Activity
                                -->
                                <li data-match-route="/" class="active">
                                    <a href="" class="dropdown-toggle">
                                        <span>Statistics</span>
                                        <i class="fa fa-angle-right drop-icon"></i>
                                    </a>
                                    <ul class="submenu">
                                        <li>
                                            <a data-match-route="/appver" href="#/appver">
                                                App Version
                                            </a>
                                        </li>
                                        <li>
                                            <a data-match-route="/device" href="#/device">
                                                Device
                                            </a>
                                        </li>
                                        <li>
                                            <a data-match-route="/sdk" href="#/sdk">
                                                SDK Level
                                            </a>
                                        </li>
                                        <li>
                                            <a data-match-route="/country" href="#/country">
                                                Country
                                            </a>
                                        </li>
                                        <li>
                                            <a data-match-route="/class" href="#/class">
                                                Class
                                            </a>
                                        </li>
                                    </ul>
                                </li>


                                <!--
                                <li class="nav-header hidden-sm hidden-xs">
                                    Setting
                                </li>

                                <li>
                                    <a href="/#">
                                        <span>App Name</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>Device</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>App Category</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>Stage</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>Time Zone</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>Viewer</span>
                                    </a>
                                </li>
                                <li>
                                    <a href="/">
                                        <span>Proguard</span>
                                    </a>
                                </li>
                                -->
                            </ul>
                        </div>
                        <div class="collapse navbar-collapse navbar-ex1-collapse" id="sidebar-nav" bs-navbar>
                            <ul class="nav nav-pills nav-stacked">
                                <li class="nav-header nav-header-first hidden-sm hidden-xs">
                                    Settings
                                </li>
                                <li>
                                    <a data-match-route="/proguard" href="#/proguard">
                                        <span>Proguard</span>
                                    </a>
                                </li>
                                <li>
                                    <a data-match-route="/dsym" href="#/dsym">
                                        <span>dSYM</span>
                                    </a>
                                </li>
                            </ul>
                        </div>
                    </div>
                </section>
                <div id="nav-col-submenu"></div>
            </div>

            <div id="content-wrapper">
                <div class="row">
                    <div class="col-lg-12">
                        <div class="slide-main-container">
                            <div ng-view autoscroll="true" class="slide-main-animation"></div>
                        </div>

                    </div>
                </div>


            </div>
        </div>
    </div>




</div>

<script src="js/bootstrap.js"></script>
